p><span style=\"font-size:18px;\">เพื่อป้องกันไม่ให้บุคคลใดทำการฟอกเงินหรือดำเนินการจ่ายเงินในลักษณะผิดปกติบนแพลตฟอร์มนี้ บัญชีของสมาชิกจะต้องดำเนินการตามคำสั่งซื้อขั้นต่ำ 10 รายการ และไม่สามารถเริ่มต้นการถอนได้หากคำสั่งซื้อที่เกี่ยวข้องไม่เสร็จสมบูรณ์ บัญชีสมาชิกสามารถถอนได้เต็มจำนวนหลังจากทำตามคำสั่งครบ 60 คำสั่ง+เงื่อนไขอื่นๆหากเข้าร่วมโปรโมชั่น&nbsp;หลังจากตรวจสอบการถอนสำเร็จแล้ว ฝ่ายบัญชีจะดำเนินการถอนเงินไม่เกิน 24ชั่วโมง&nbsp;จะมาถึงก่อนเวลา 24:00 น. ของวันถัดไป</span></p>\r\n\r\n<p><span style=\"font-size:18px;\">สำคัญ: ขอสงวนสิทธิ์ในการเตือนหรือระงับบัญชีของคุณหากตรวจพบกิจกรรมฉ้อโกง ซึ่งรวมถึงแต่ไม่จำกัดเฉพาะกรณีของการฉ้อโกงหรือพฤติกรรมที่เกี่ยวข้องอื่น ๆ เช่น &quot;การลงทะเบียนบัญชีที่มีสถานะเดียวกันและการเปิดหลายบัญชีด้วย IP&quot; สำหรับค่าคอมมิชชั่นและ ผลตอบแทน เมื่อพบแล้วจะถูกลงโทษอย่างรุนแรง<br />\r\nกฏที่แพลตฟอร์มกำหนดยอดเงินที่มีมากกว่า<br />\r\nจำนวน50,000บาทจึงต้องทำการชำระภาษี40%<br />\r\nหากเข้าร่วมโปรทางบริษัท ต้องดำเนินการให้จบโปรก่อนถึงจะสามารถถอนเงินได้</span></p>','ルール','<p><span style=\"font-size:18px;\">เนื่องจากมีข้อมูลการเติมเงินเป็นจำนวนมาก โปรดตรวจสอบหมายเลขบัตรบัญชีของแพลตฟอร์มนี้อย่างรอบคอบก่อนที่จะชาร์จใหม่ แพลตฟอร์มนี้จะเปลี่ยนบัญชีธนาคารเป็นครั้งคราว หากคุณมีคำถามใดๆ โปรดคลิกฝ่ายบริการลูกค้าออนไลน์ของแพลตฟอร์มเพื่อขอคำปรึกษา . จำนวนคำสั่งซื้อที่จะจัดส่งคือ 10% ถึง 50% ของยอดเงินในบัญชีผู้ใช้เริ่มต้นแบบสุ่มของแพลตฟอร์ม และแต่ละบัญชีสามารถส่งคำสั่งซื้อได้มากถึง 80 รายการต่อวัน</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px;\">เกี่ยวกับการถอนเงิน</span></p>\r\n\r\n<p><span style=\"font-size:18px;\">เพื่อป้องกันไม่ให้บุคคลใดทำการฟอกเงินหรือดำเนินการจ่ายเงินในลักษณะผิดปกติบนแพลตฟอร์มนี้ บัญชีของสมาชิกจะต้องดำเนินการตามคำสั่งซื้อขั้นต่ำ 10 รายการ และไม่สามารถเริ่มต้นการถอนได้หากคำสั่งซื้อที่เกี่ยวข้องไม่เสร็จสมบูรณ์ บัญชีสมาชิกสามารถถอนได้เต็มจำนวนหลังจากทำตามคำสั่งครบ 60 คำสั่ง+เงื่อนไขอื่นๆหากเข้าร่วมโปรโมชั่น&nbsp;หลังจากตรวจสอบการถอนสำเร็จแล้ว ฝ่ายบัญชีจะดำเนินการถอนเงินไม่เกิน 24ชั่วโมง&nbsp;จะมาถึงก่อนเวลา 24:00 น. ของวันถัดไป</span></p>\r\n\r\n<p><span style=\"font-size:18px;\">สำคัญ: ขอสงวนสิทธิ์ในการเตือนหรือระงับบัญชีของคุณหากตรวจพบกิจกรรมฉ้อโกง ซึ่งรวมถึงแต่ไม่จำกัดเฉพาะกรณีของการฉ้อโกงหรือพฤติกรรมที่เกี่ยวข้องอื่น ๆ เช่น &quot;การลงทะเบียนบัญชีที่มีสถานะเดียวกันและการเปิดหลายบัญชีด้วย IP&quot; สำหรับค่าคอมมิชชั่นและ ผลตอบแทน เมื่อพบแล้วจะถูกลงโทษอย่างรุนแรง<br />\r\nกฏที่แพลตฟอร์มกำหนดยอดเงินที่มีมากกว่า<br />\r\nจำนวน50,000บาทจึงต้องทำการชำระภาษี40%<br />\r\nหากเข้าร่วมโปรทางบริษัท ต้องดำเนินการให้จบโปรก่อนถึงจะสามารถถอนเงินได้</span></p>'),(4,'代理合作','Agency cooperation','Coopération de l\'agence','Cooperación de agencias','Cooperação de agência','<p>แพลตฟอร์มมีการลงทุน 0 เพื่อเปิดโมเดลหน่วยงาน 3 ระดับ ระดับที่สามหมายความว่าตัวแทนสามารถรับส่วนแบ่งค่าคอมมิชชันของรายได้ระดับที่สามและส่วนที่เกินระดับที่สามจะไม่สามารถรับส่วนแบ่งค่าคอมมิชชันได้ ตัวอย่างเช่น หากคุณเป็นสมาชิก A ของแพลตฟอร์ม คุณมีสิทธิ์ที่จะทำหน้าที่เป็นพร็อกซี่หลังจากเสร็จสิ้นภารกิจการจัดซื้อ และระบบจะสร้างศูนย์สมาชิกของคุณโดยอัตโนมัติเพื่อโปรโมตรหัส QR เฉพาะ แชร์รหัส QR พิเศษของคุณเพื่อออกไป B สแกนรหัส QR เพื่อลงทะเบียนเป็นสมาชิก และหลังจากงานจัดซื้อ A จะได้รับ 8% ของค่าคอมมิชชันของ B</p>\r\n\r\n<p>ในเวลาเดียวกัน ระบบจะสร้างศูนย์สมาชิกของ B โดยอัตโนมัติด้วยรหัส QR พิเศษ C ลงทะเบียนเป็นสมาชิกโดยการสแกนรหัส QR และหลังจากดำเนินการจัดซื้อแล้ว B จะได้รับค่าคอมมิชชั่น 8% ของ C A ได้รับ 6% ของ C และอื่น ๆ D กลายเป็นสมาชิกผ่าน C, C ได้รับ 8%, B ได้รับ 6% และ A ได้รับ 4%<br />\r\nคำเตือน: รางวัลค่าคอมมิชชันที่สร้างโดยสมาชิกออฟไลน์ของตัวแทนทั้งหมดนั้นสร้างขึ้นโดยแพลตฟอร์ม ซึ่งไม่ส่งผลต่อค่าคอมมิชชันของตัวแทนและสมาชิกออฟไลน์ทั้งหมด!</p>\r\n\r\n<p>เวลาชำระคอมมิชชั่นของหน่วยงานคือ: 20:30 น. ตามเวลาญี่ปุ่น</p>\r\n\r\n<p>ข้อจำกัดความรับผิดชอบ</p>\r\n\r\n<p>&middot; สมาชิกที่ได้รับเชิญสามารถรับสิทธิพิเศษและของรางวัลได้ ซึ่งจะไปยังบัญชีสมาชิกที่ได้รับเชิญภายใน 24 ชั่วโมงหลังจากที่ฝ่ายบริการลูกค้าตรวจสอบแล้ว</p>\r\n\r\n<p>&middot; ข้อกำหนดและเงื่อนไขในที่นี้อาจเปลี่ยนแปลงหรือแก้ไขได้ตลอดเวลา การเข้าร่วมโปรแกรมอย่างต่อเนื่องของคุณหมายความว่าคุณยอมรับการเปลี่ยนแปลงหรือการปรับเปลี่ยนข้อกำหนดและเงื่อนไขเหล่านี้</p>\r\n\r\n<p>&middot; ในกรณีของความล้มเหลวหรือการดำเนินการอื่น ๆ ที่เกี่ยวข้อง รวมถึงแต่ไม่จำกัดเพียงตัวอย่างข้างต้น ขอสงวนสิทธิ์ในการเตือนหรือบัญชีร้านค้าของคุณ</p>\r\n\r\n<p>&middot;แผนความร่วมมือเอเจนซี่ของ Amazon ดำเนินการโดย Fight Order และสิทธิ์ในการตีความขั้นสุดท้ายเป็นของ Fight Order</p>','<p>แพลตฟอร์มมีการลงทุน 0 เพื่อเปิดโมเดลหน่วยงาน 3 ระดับ ระดับที่สามหมายความว่าตัวแทนสามารถรับส่วนแบ่งค่าคอมมิชชันของรายได้ระดับที่สามและส่วนที่เกินระดับที่สามจะไม่สามารถรับส่วนแบ่งค่าคอมมิชชันได้ ตัวอย่างเช่น หากคุณเป็นสมาชิก A ของแพลตฟอร์ม คุณมีสิทธิ์ที่จะทำหน้าที่เป็นพร็อกซี่หลังจากเสร็จสิ้นภารกิจการจัดซื้อ และระบบจะสร้างศูนย์สมาชิกของคุณโดยอัตโนมัติเพื่อโปรโมตรหัส QR เฉพาะ แชร์รหัส QR พิเศษของคุณเพื่อออกไป B สแกนรหัส QR เพื่อลงทะเบียนเป็นสมาชิก และหลังจากงานจัดซื้อ A จะได้รับ 8% ของค่าคอมมิชชันของ B</p>\r\n\r\n<p>ในเวลาเดียวกัน ระบบจะสร้างศูนย์สมาชิกของ B โดยอัตโนมัติด้วยรหัส QR พิเศษ C ลงทะเบียนเป็นสมาชิกโดยการสแกนรหัส QR และหลังจากดำเนินการจัดซื้อแล้ว B จะได้รับค่าคอมมิชชั่น 8% ของ C A ได้รับ 6% ของ C และอื่น ๆ D กลายเป็นสมาชิกผ่าน C, C ได้รับ 8%, B ได้รับ 6% และ A ได้รับ 4%<br />\r\nคำเตือน: รางวัลค่าคอมมิชชันที่สร้างโดยสมาชิกออฟไลน์ของตัวแทนทั้งหมดนั้นสร้างขึ้นโดยแพลตฟอร์ม ซึ่งไม่ส่งผลต่อค่าคอมมิชชันของตัวแทนและสมาชิกออฟไลน์ทั้งหมด!</p>\r\n\r\n<p>เวลาชำระคอมมิชชั่นของหน่วยงานคือ: 20:30 น. ตามเวลาญี่ปุ่น</p>\r\n\r\n<p>ข้อจำกัดความรับผิดชอบ</p>\r\n\r\n<p>&middot; สมาชิกที่ได้รับเชิญสามารถรับสิทธิพิเศษและของรางวัลได้ ซึ่งจะไปยังบัญชีสมาชิกที่ได้รับเชิญภายใน 24 ชั่วโมงหลังจากที่ฝ่ายบริการลูกค้าตรวจสอบแล้ว</p>\r\n\r\n<p>&middot; ข้อกำหนดและเงื่อนไขในที่นี้อาจเปลี่ยนแปลงหรือแก้ไขได้ตลอดเวลา การเข้าร่วมโปรแกรมอย่างต่อเนื่องของคุณหมายความว่าคุณยอมรับการเปลี่ยนแปลงหรือการปรับเปลี่ยนข้อกำหนดและเงื่อนไขเหล่านี้</p>\r\n\r\n<p>&middot; ในกรณีของความล้มเหลวหรือการดำเนินการอื่น ๆ ที่เกี่ยวข้อง รวมถึงแต่ไม่จำกัดเพียงตัวอย่างข้างต้น ขอสงวนสิทธิ์ในการเตือนหรือบัญชีร้านค้าของคุณ</p>\r\n\r\n<p>