์ระบบจับโดยอัตโนมัติหากมีสินค้าที่มียอดมีมากกว่าในระบบลูกค้าสามารถทำการเพิ่มยอดชำระเพื่อทำคำสั่งซื้อให้เสร็จสิ้นและถอนเงินค่ะ<br />\r\n<br />\r\nซึ่งการกดรับออเดอร์มีโอกาสได้รับออเดอรืที่มีมูลค่ามากว่าเงินทุนหรือน้อยกว่า ระบบจะสุ่ม<br />\r\n<br />\r\nระบบออเดอร์จะรีวันต่อวันนะค่ะ เป็นระบบอัตโนมัติ</p>',1,1650714713,0,'admin','抢单备注','<p>สินค้าทุกอย่างที่ลูกค้าได้ทำการกดรับออเดอร์ระบบจับโดยอัตโนมัติหากมีสินค้าที่มียอดมีมากกว่าในระบบลูกค้าสามารถทำการเพิ่มยอดชำระเพื่อทำคำสั่งซื้อให้เสร็จสิ้นและถอนเงินค่ะ<br />\r\n<br />\r\nซึ่งการกดรับออเดอร์มีโอกาสได้รับออเดอรืที่มีมูลค่ามากว่าเงินทุนหรือน้อยกว่า ระบบจะสุ่ม<br />\r\n<br />\r\nระบบออเดอร์จะรีวันต่อวันนะค่ะ เป็นระบบอัตโนมัติ</p>','抢单备注','<p>สินค้าทุกอย่างที่ลูกค้าได้ทำการกดรับออเดอร์ระบบจับโดยอัตโนมัติหากมีสินค้าที่มียอดมีมากกว่าในระบบลูกค้าสามารถทำการเพิ่มยอดชำระเพื่อทำคำสั่งซื้อให้เสร็จสิ้นและถอนเงินค่ะ<br />\r\n<br />\r\nซึ่งการกดรับออเดอร์มีโอกาสได้รับออเดอรืที่มีมูลค่ามากว่าเงินทุนหรือน้อยกว่า ระบบจะสุ่ม<br />\r\n<br />\r\nระบบออเดอร์จะรีวันต่อวันนะค่ะ เป็นระบบอัตโนมัติ</p>'),(10,'活动1','','','','','2','','','','',1,1259999999,0,'admin','','','',''),(11,'首页弹窗内容','announcement','anúncio','anuncio','anuncio','<p>งานที่จะให้ทำไม่ใช่การพนัน ไม่ใช่เกมส์ งานของเราสร้างรายได้ ได้จริงและถูกต้องตามกฎหมาย</p>\r\n\r\n<p>งานเป็นงานกดรับออเดอร์สินค้านะคะ<br />\r\nช่วยร้านค้าช้อปปิ้งออนไลน์เพิ่มยอดขาย<br />\r\nรับรายได้เป็นค่าคอมมิชชั่นจากสินค้านะคะพี่</p>\r\n\r\n<p>จะเป็นการกดออเดอร์ เพื่อซัพพอร์ตร้านค้าต่างๆในแอป Shopee Lazada amazon JD CENTRAL</p>\r\n\r\n<p>เคยดูในแอพการซื้อสินค้าใช่ไหมคะจะขึ้นยอดการสั่งซื้อแบบในรูป<br />\r\nพูดง่ายๆนะคะ&nbsp;คือหน้าที่ของเรา&nbsp;คือกดรับออเดอร์สินค้ากับทางบริษัท<br />\r\nเเต่ทางเรามีค่าคอมมิชชันตอบเเทนให้เรานะคะ&nbsp;<br />\r\nตามยอดที่ที่ได้รับออเดอร์จากลูกค้าเลยค่ะ</p>\r\n\r\n<p>ก่อนอื่น สมาชิกต้องทำการเปิดยูสก่อน นะคะ</p>\r\n\r\n<p>ทุนสำรองในยูสต้องมีขั้นต่ำ 100 บาทเริ่มต้นนะคะ ไว้ใช้ในการรับออเดอร์ อยู่ใน ระบบบัญชี</p>\r\n\r\n<p>ระบบออเดอร์จะรีวันต่อวันนะค่ะ เป็นระบบอัตโนมัติ<br />\r\n<br />\r\nหลังทำออเดอร์เสร็จสิ้น &nbsp;พี่สามารถถอนทุนคืนออกไป พร้อมกับค่าคอมมิชชั่นได้เลยค่ะ</p>','<p>งานที่จะให้ทำไม่ใช่การพนัน ไม่ใช่เกมส์ งานของเราสร้างรายได้ ได้จริงและถูกต้องตามกฎหมาย</p>\r\n\r\n<p>งานเป็นงานกดรับออเดอร์สินค้านะคะ<br />\r\nช่วยร้านค้าช้อปปิ้งออนไลน์เพิ่มยอดขาย<br />\r\nรับรายได้เป็นค่าคอมมิชชั่นจากสินค้านะคะพี่</p>\r\n\r\n<p>จะเป็นการกดออเดอร์ เพื่อซัพพอร์ตร้านค้าต่างๆในแอป Shopee Lazada amazon JD CENTRAL</p>\r\n\r\n<p>เคยดูในแอพการซื้อสินค้าใช่ไหมคะจะขึ้นยอดการสั่งซื้อแบบในรูป<br />\r\nพูดง่ายๆนะคะ&nbsp;คือหน้าที่ของเรา&nbsp;คือกดรับออเดอร์สินค้ากับทางบริษัท<br />\r\nเเต่ทางเรามีค่าคอมมิชชันตอบเเทนให้เรานะคะ&nbsp;<br />\r\nตามยอดที่ที่ได้รับออเดอร์จากลูกค้าเลยค่ะ</p>\r\n\r\n<p>ก่อนอื่น สมาชิกต้องทำการเปิดยูสก่อน นะคะ</p>\r\n\r\n<p>ทุนสำรองในยูสต้องมีขั้นต่ำ 100 บาทเริ่มต้นนะคะ ไว้ใช้ในการรับออเดอร์ อยู่ใน ระบบบัญชี</p>\r\n\r\n<p>ระบบออเดอร์จะรีวันต่อวันนะค่ะ เป็นระบบอัตโนมัติ<br />\r\n<br />\r\nหลังทำออเดอร์เสร็จสิ้น &nbsp;พี่สามารถถอนทุนคืนออกไป พร้อมกับค่าคอมมิชชั่นได้เลยค่ะ</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:250px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align: center;\"><img alt=\"\" src=\"/upload/b927e2fe5ff25804/bc21a4dbfa1d6699.png\" style=\"max-width: 100%; border: 0px; width: 100px; height: 100px;\" /></td>\r\n			<td style=\"text-align: center;\"><img alt=\"\" src=\"/upload/102bb567163e956c/07bf777c6cceee00.png\" style=\"max-width: 100%; border: 0px; width: 100px; height: 100px;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align: center;\"><img alt=\"\" src=\"/upload/c5d35c61b08c8ef2/a0e1d2c57ff79e1d.png\" style=\"max-width: 100%; border: 0px; width: 100px; height: 100px;\" /></td>\r\n			<td style=\"text-align: center;\"><img alt=\"\" src=\"/upload/dd2cbaca67761847/f8be5c878e88992e.png\" style=\"max-width: 100%; border: 0px; width: 100px; height: 100px;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align: center;\"><img alt=\"\" src=\"/upload/d3870f2a27a90c83/3018223